		"text": "새벽을 깨운 폭격소리. 전쟁이라는 믿기 힘든 현실에 우크라이나는 패닉에 빠졌습니다. 수도 키이우(키예프)를 포함, 동시다발적인 공격에 우크라이나에는 절규가 가득합니다.\n\n최소 750만명의 아이들이 집과 가족을 잃고 실향민이 될 처지에 놓인 비극적인 상황. 아이들에게 구호물품을 보내주세요."
